import React from "react";
import styled from "styled-components";

function Card(props){

    return(
        <Container>
            <Text>
                {props.children}
            </Text>
            <img href={props.image}/>
        </Container>
    )
}

export {Card};

const Container = styled.div`
text-align:center;
background-color:black;
width:auto;
width:100%;
border:2px solid #FDC500;
`

const Text = styled.h2`
color:#F5B716`;
